uint8_t L1CReadConfigParams()
{
    uint8_t parm[MAX_L1C_CONFIG_PARAMETERS][40];
    FILE *fp;
    uint32_t i=0,i1,i2,i3,i4,i5,i6;
#if (defined(DSP_MAC_ADDRESS_HARDCODING) || defined(BSP_MAC_ADDRESS_HARDCODING))
    uint32_t validMacAddr = 0;
    uint32_t idx = 0;
#endif

    L1C_CONFIG_DB * pL1CConfigDB = &g_L1CConfigDB;
    sint32_t g1,g2;
    
    if((fp = fopen("l1c_cfg_parm.txt","r")) == NULL)
    {
       printf("Unable to open l1c_cfg_parm.txt, abort!\n");
       return 0;
    }
    fscanf(fp,"%s %*s \
                   %x %x %x %x %x %x",parm[i++],
                  &i1,&i2,&i3,&i4,&i5,&i6);
    pL1CConfigDB->l23SrcMacAddr[0] = (uint8_t)i1;
    pL1CConfigDB->l23SrcMacAddr[1] = (uint8_t)i2;
    pL1CConfigDB->l23SrcMacAddr[2] = (uint8_t)i3;
    pL1CConfigDB->l23SrcMacAddr[3] = (uint8_t)i4;
    pL1CConfigDB->l23SrcMacAddr[4] = (uint8_t)i5;
    pL1CConfigDB->l23SrcMacAddr[5] = (uint8_t)i6;
    fscanf(fp,"%s %*s \
                   %x %x %x %x %x %x",parm[i++],
                   &i1,&i2,&i3,&i4,&i5,&i6);
    pL1CConfigDB->l1DstMacAddr[0] = (uint8_t)i1;
    pL1CConfigDB->l1DstMacAddr[1] = (uint8_t)i2;
    pL1CConfigDB->l1DstMacAddr[2] = (uint8_t)i3;
    pL1CConfigDB->l1DstMacAddr[3] = (uint8_t)i4;
    pL1CConfigDB->l1DstMacAddr[4] = (uint8_t)i5;
    pL1CConfigDB->l1DstMacAddr[5] = (uint8_t)i6;
    printf("L1C debug: host MAC address is %#x:%#x:%#x:%#x:%#x:%#x\n",
               pL1CConfigDB->l23SrcMacAddr[0]&0xff,pL1CConfigDB->l23SrcMacAddr[1]&0xff,pL1CConfigDB->l23SrcMacAddr[2]&0xff,
               pL1CConfigDB->l23SrcMacAddr[3]&0xff,pL1CConfigDB->l23SrcMacAddr[4]&0xff,pL1CConfigDB->l23SrcMacAddr[5]&0xff);
    printf("L1C debug: Board MAC address is %#x:%#x:%#x:%#x:%#x:%#x\n",
               pL1CConfigDB->l1DstMacAddr[0]&0xff,pL1CConfigDB->l1DstMacAddr[1]&0xff,pL1CConfigDB->l1DstMacAddr[2]&0xff,
               pL1CConfigDB->l1DstMacAddr[3]&0xff,pL1CConfigDB->l1DstMacAddr[4]&0xff,pL1CConfigDB->l1DstMacAddr[5]&0xff);

#ifdef BSP_MAC_ADDRESS_HARDCODING
    for(idx = 0; idx < NUM_SUPP_MAC_ADDR; idx++)
    {
       if(   (gBspMacAddrCfg[idx][0] == pL1CConfigDB->l23SrcMacAddr[0]) && (gBspMacAddrCfg[idx][1] == pL1CConfigDB->l23SrcMacAddr[1])
          && (gBspMacAddrCfg[idx][2] == pL1CConfigDB->l23SrcMacAddr[2]) && (gBspMacAddrCfg[idx][3] == pL1CConfigDB->l23SrcMacAddr[3])
          && (gBspMacAddrCfg[idx][4] == pL1CConfigDB->l23SrcMacAddr[4]) && (gBspMacAddrCfg[idx][5] == pL1CConfigDB->l23SrcMacAddr[5]))
       {
          validMacAddr = 1;
       }
    }
    if(validMacAddr != 1)
    {
       printf("=============ERROR: Wrong Source MAC Address =========\n");
       exit(0);
    }
	validMacAddr = 0;
#endif

#ifdef DSP_MAC_ADDRESS_HARDCODING
    for(idx = 0; idx < NUM_SUPP_MAC_ADDR; idx++)
    {
       if(   (gDspMacAddrCfg[idx][0] == pL1CConfigDB->l1DstMacAddr[0]) && (gDspMacAddrCfg[idx][1] == pL1CConfigDB->l1DstMacAddr[1])
          && (gDspMacAddrCfg[idx][2] == pL1CConfigDB->l1DstMacAddr[2]) && (gDspMacAddrCfg[idx][3] == pL1CConfigDB->l1DstMacAddr[3])
          && (gDspMacAddrCfg[idx][4] == pL1CConfigDB->l1DstMacAddr[4]) && (gDspMacAddrCfg[idx][5] == pL1CConfigDB->l1DstMacAddr[5]))
       {
          validMacAddr = 1;
       }
    }
    if(validMacAddr != 1)
    {
       printf("=============ERROR: Wrong Destination MAC Address =========\n");
       exit(0);
    }
#endif

    fscanf(fp,"%s %*s %s", parm[i++], &pL1CConfigDB->deviceHost[0]);  	
    fscanf(fp,"%s %*s %d %d",parm[i++],&g1,&g2);    
    pL1CConfigDB->txPwrGain = (uint16_t)((g1+80)*32);
    pL1CConfigDB->rxGain = (uint16_t)g2;
    printf("L1C Tx Power/rx gain are: %ddbm, %ddb,ADI radio reg are 0x%x,0x%x\n",           
            g1,g2,pL1CConfigDB->txPwrGain,pL1CConfigDB->rxGain);   

    fscanf(fp,"%*s %*s %d", &boardDspType);

    printf("BOARD DSP TYPE = %d , Index i = %d \n" , boardDspType , i);

    fscanf(fp,"%*s %*s %d", &gUmtsConfig.gpsWeek);
    printf("GPS WEEK = %d\n", gUmtsConfig.gpsWeek);
    fscanf(fp,"%*s %*s %d", &gUmtsConfig.gpsTow);
    printf("GPS Tow  = %d\n", gUmtsConfig.gpsTow);
    fscanf(fp,"%*s %*s %d", &logsEnabled);
    printf("Logs-Enabled = %d\n", logsEnabled);

    fscanf(fp,"%*s %*s %d", &pumpDataLoad);
    printf("Pump-Data-Load = %d\n", pumpDataLoad);

    if (fp)
    {
    	fclose(fp);
		fp = NULL;
    }
    
    return 1;

}


